import React, {memo} from 'react';
import styled from 'styled-components';

const FooterContainer = styled.div`
    border-top:3px solid #ffe600;

    .footerInner{
      marin-top:20px;
      background-color: #ffe600;
      max-width: 1200px;
      margin:0 auto;
    }
`;

const Footer = memo(() => {
  return (
    <FooterContainer>
      <div className='footerInner'>
      <h1>Footer</h1>
      </div>
      
    </FooterContainer>
  );
});

export default Footer;
